const edit = (props) => {
    const day = '금'
    return (
        <div>
            <h1>{day}요일 평점 남기기</h1>
            <div className='score'></div>
            <div className='score'></div>
            <div className='score'></div>
            <div className='score'></div>
            <div className='score'></div>
            <button>평점 남기기</button>
        </div>
    )
}

export default edit;
